function(){
  var path = {{Page Path}};
  var query = {{URL - Query - WOVG}};
  var queryConfig = {{Const - Query - Accepted - WOVG - Config}};
  var queryList = queryConfig && queryConfig.length > 0 ? queryConfig.split(',') : undefined;
  var queryReplace = '';
  if(/\*/.test(queryConfig)){
    return undefined;
  } else if(query && query.length > 0) {
    queryList.forEach(function(value) {
      if(query.indexOf(value+'=') >= 0){
        queryReplace += queryReplace == '' ? '?' : '&';  
        queryReplace +=  value +'='+query.split(value+'=')[1].split('&')[0];
      }                        
    });
    return path+queryReplace;
  }
  return path;
}

